import React, { Component } from 'react';
import { library } from "@fortawesome/fontawesome-svg-core";
import { faCloudSun, faCloud, faBolt, faWind, faCloudRain, faCloudSunRain, faCloudShowersHeavy, faSnowflake } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
library.add(faCloudSun, faCloud, faBolt, faWind, faCloudRain, faCloudSunRain, faCloudShowersHeavy, faSnowflake);
class WeatherIcon extends Component {
    state = {
        iconReference: [
            [{ Main: 'Clear', iconName: 'sun', class: 'sun' }],
            [{ Main: 'Rain', iconName: 'cloud-rain', class: 'rain' }],
            [{ Main: 'Thunderstorm', iconName: 'bolt', class: 'thunderstorm' }],
            [{ Main: 'Clouds', iconName: 'cloud', class: 'cloud' }],
            [{ Main: 'Snow', iconName: 'snowflake', class: 'snow' }]
        ]
    }

    getIconReference = (mainStatus) => {
        let item = this.state.iconReference;

    }

    render() {
        //   const {iconName, iconClass} = this.getIconReference(this.props.status);
        if (this.props.status) {
            this.getIconReference(this.props.status);
        }

        return (
            <div>
                <FontAwesomeIcon
                    icon="snow"

                    size={this.props.size}

                />
            </div>
        );
    }
}

export default WeatherIcon;
